/*Table structure for table `system_announcement` */

DROP TABLE IF EXISTS `system_announcement`;

CREATE TABLE `system_announcement` (
  `announcement_id` varchar(32) NOT NULL DEFAULT '' COMMENT '主键id',
  `sent_userid` varchar(32) DEFAULT NULL COMMENT '发送人id',
  `request_userid` varchar(2000) DEFAULT NULL COMMENT '收件人id',
  `sent_time` datetime DEFAULT NULL COMMENT '发送时间',
  `end_time` datetime DEFAULT NULL COMMENT '有效期',
  `announcement_status` varchar(10) DEFAULT NULL COMMENT '发送状态',
  `announcement_title` varchar(800) DEFAULT NULL COMMENT '公告标题',
  `announcement_content` text COMMENT '公告内容',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  PRIMARY KEY (`announcement_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统公告';

/*Data for the table `system_announcement` */

/*Table structure for table `system_announcement_user` */

DROP TABLE IF EXISTS `system_announcement_user`;

CREATE TABLE `system_announcement_user` (
  `keu_id` varchar(32) NOT NULL DEFAULT '' COMMENT '主键id',
  `announcement_id` varchar(32) DEFAULT NULL COMMENT 'announcement_id',
  `user_id` varchar(32) DEFAULT NULL COMMENT '接收人id',
  `record_status` varchar(10) DEFAULT NULL COMMENT '阅读状态',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  PRIMARY KEY (`keu_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统公告用户明细';

/*Data for the table `system_announcement_user` */

/*Table structure for table `system_attachment` */

DROP TABLE IF EXISTS `system_attachment`;

CREATE TABLE `system_attachment` (
  `file_id` varchar(32) NOT NULL DEFAULT '' COMMENT '主键id',
  `data_id` varchar(32) DEFAULT NULL COMMENT '数据id',
  `table_name` varchar(60) DEFAULT NULL COMMENT '表名或标识',
  `type_id` varchar(32) DEFAULT NULL COMMENT '附件分类id',
  `dept_name` varchar(80) DEFAULT NULL COMMENT '部门',
  `dept_id` varchar(32) DEFAULT NULL COMMENT 'dept_id',
  `file_name` varchar(80) DEFAULT NULL COMMENT '文件名',
  `file_type` varchar(20) DEFAULT NULL COMMENT '文件类型',
  `file_path` varchar(500) DEFAULT NULL COMMENT '文件路径',
  `file_size` varchar(50) DEFAULT NULL COMMENT '文件大小',
  `file_md5` varchar(32) DEFAULT NULL COMMENT 'MD5',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  `file_date` datetime DEFAULT NULL COMMENT '创建时间',
  `upload_user` varchar(50) DEFAULT NULL COMMENT '上传人',
  `upload_ip` varchar(50) DEFAULT NULL COMMENT '上传IP',
  PRIMARY KEY (`file_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='图文附件';

