/*Table structure for table `system_log_detail` */

DROP TABLE IF EXISTS `system_log_detail`;

CREATE TABLE `system_log_detail` (
  `detail_id` varchar(32) NOT NULL DEFAULT '' COMMENT 'detail_id',
  `log_id` varchar(32) DEFAULT NULL COMMENT 'log_id',
  `log_time` datetime DEFAULT NULL COMMENT '发生时间',
  `log_level` varchar(10) DEFAULT NULL COMMENT '日志级别',
  `log_content` text COMMENT '日志内容',
  `fun_id` varchar(32) DEFAULT NULL COMMENT 'funId',
  `user_id` varchar(32) DEFAULT NULL COMMENT 'user_id',
  `data_id` varchar(32) DEFAULT NULL COMMENT 'data_id',
  PRIMARY KEY (`detail_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统日志明细';

