/*Table structure for table `system_message` */

DROP TABLE IF EXISTS `system_message`;

CREATE TABLE `system_message` (
  `message_id` varchar(32) NOT NULL DEFAULT '' COMMENT '主键id',
  `sent_userid` varchar(32) DEFAULT NULL COMMENT '发送人id',
  `request_userid` varchar(2000) DEFAULT NULL COMMENT '收件人id',
  `sent_time` datetime DEFAULT NULL COMMENT '发送时间',
  `message_status` varchar(10) DEFAULT NULL COMMENT '发送状态',
  `message_title` varchar(800) DEFAULT NULL COMMENT '标题',
  `message_content` text COMMENT '消息内容',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  PRIMARY KEY (`message_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统消息';

