DROP TABLE IF EXISTS `system_message_user`;

CREATE TABLE `system_message_user` (
  `keu_id` varchar(32) NOT NULL DEFAULT '' COMMENT '主键id',
  `message_id` varchar(32) DEFAULT NULL COMMENT 'message_id',
  `user_id` varchar(32) DEFAULT NULL COMMENT '接收人id',
  `record_status` varchar(10) DEFAULT NULL COMMENT '阅读状态',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  PRIMARY KEY (`keu_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统消息用户明细';

/*Data for the table `system_message_user` */

/*Table structure for table `system_online` */

DROP TABLE IF EXISTS `system_online`;

CREATE TABLE `system_online` (
  `login_id` varchar(60) NOT NULL COMMENT 'login_id',
  `project_id` varchar(32) DEFAULT NULL COMMENT 'project_id',
  `user_id` varchar(32) DEFAULT NULL COMMENT 'user_id',
  `user_name` varchar(60) DEFAULT NULL COMMENT '用户名称',
  `login_time` datetime DEFAULT NULL COMMENT '登录时间',
  `login_status` varchar(10) DEFAULT NULL COMMENT '状态',
  `login_ip` varchar(60) DEFAULT NULL COMMENT '登录IP',
  `logout_time` datetime DEFAULT NULL COMMENT '退出时间',
  `browser_type` varchar(60) DEFAULT NULL COMMENT '浏览器类型',
  `dept_id` varchar(32) DEFAULT NULL COMMENT 'dept_id',
  `dept_name` varchar(32) DEFAULT NULL COMMENT '部门管理',
  `last_viewurl` varchar(500) DEFAULT NULL COMMENT '最后访问功能',
  `last_fleshtime` datetime DEFAULT NULL COMMENT '最后访问时间',
  PRIMARY KEY (`login_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户在线状态';

