/*Table structure for table `system_role_fun` */

DROP TABLE IF EXISTS `system_role_fun`;

CREATE TABLE `system_role_fun` (
  `det_id` varchar(32) NOT NULL COMMENT '主键',
  `role_id` varchar(32) DEFAULT NULL COMMENT '角色id',
  `project_funid` varchar(32) DEFAULT NULL COMMENT '项目功能id',
  `fun_id` varchar(32) DEFAULT NULL COMMENT '功能id',
  `event_edit` varchar(10) DEFAULT NULL COMMENT '编辑事件权限',
  `event_sign` varchar(10) DEFAULT NULL COMMENT '复核事件权限',
  `event_audit` varchar(10) DEFAULT NULL COMMENT '审批事件权限',
  `event_delete` varchar(10) DEFAULT NULL COMMENT '删除事件权限',
  `event_print` varchar(10) DEFAULT NULL COMMENT '打印事件权限',
  `dataright_sql` varchar(300) DEFAULT NULL COMMENT '数据权限SQL',
  `add_userid` varchar(32) DEFAULT NULL COMMENT 'add_userid',
  `add_date` datetime DEFAULT NULL COMMENT 'add_date',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT 'modify_userid',
  `modify_date` datetime DEFAULT NULL COMMENT 'modify_date',
  `record_flag` varchar(10) DEFAULT NULL COMMENT 'record_flag',
  `is_access` varchar(10) DEFAULT NULL COMMENT '访问权限',
  PRIMARY KEY (`det_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统角色表功能明细';

