/*Table structure for table `tool_function` */

DROP TABLE IF EXISTS `tool_function`;

CREATE TABLE `tool_function` (
  `fun_id` varchar(32) NOT NULL COMMENT 'fun_id',
  `module_id` varchar(32) DEFAULT NULL COMMENT '模块名称',
  `fun_name` varchar(40) DEFAULT NULL COMMENT '功能名称',
  `fun_type` varchar(10) DEFAULT NULL COMMENT '功能类型',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `layout_url` varchar(200) DEFAULT NULL COMMENT '布局路径',
  `grid_html` varchar(200) DEFAULT NULL COMMENT 'grid页面',
  `form_html` varchar(200) DEFAULT NULL COMMENT 'form页面',
  `table_name` varchar(60) DEFAULT NULL COMMENT '数据表',
  `db_source` varchar(10) DEFAULT NULL COMMENT '数据源',
  `query_function` varchar(200) DEFAULT NULL COMMENT '数据查询方法',
  `key_column` varchar(60) DEFAULT NULL COMMENT '主键列',
  `from_sql` varchar(500) DEFAULT NULL COMMENT 'from_sql',
  `where_sql` varchar(500) DEFAULT NULL COMMENT 'where_sql',
  `orderby_sql` varchar(500) DEFAULT NULL COMMENT 'orderby_sql',
  `is_show` varchar(10) DEFAULT NULL COMMENT '是否显示?',
  `sub_funs` varchar(200) DEFAULT NULL COMMENT '子功能',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  `tree_name` varchar(200) DEFAULT NULL COMMENT '树名字',
  `tree_function` varchar(200) DEFAULT NULL COMMENT '树数据获取方法',
  `tree_forwordwhere` varchar(200) DEFAULT NULL COMMENT '点击树触发刷新条件',
  `tree_wheresql` varchar(200) DEFAULT NULL COMMENT '过滤语句',
  `tree_topid` varchar(32) DEFAULT NULL COMMENT '顶级id',
  `audit_column` varchar(100) DEFAULT NULL COMMENT '复核字段',
  `is_audit` varchar(10) DEFAULT NULL COMMENT '是否归档?',
  `define_js` varchar(200) DEFAULT NULL COMMENT '自定义附加js',
  `ico_img` varchar(100) DEFAULT NULL COMMENT '功能图标ico',
  `fun_descript` varchar(500) DEFAULT NULL COMMENT '功能详细描述',
  `foreign_column` varchar(100) DEFAULT NULL COMMENT '外键字段',
  `tree_orderbysql` varchar(200) DEFAULT NULL COMMENT 'orderBy语句',
  `form_map` text COMMENT 'Form设计图',
  `define_modal` varchar(200) DEFAULT NULL COMMENT '自定义Modal窗口',
  `fun_parames` varchar(800) DEFAULT NULL COMMENT '其他自定义参数',
  PRIMARY KEY (`fun_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gb2312;

