/*Table structure for table `tool_function_query` */

DROP TABLE IF EXISTS `tool_function_query`;

CREATE TABLE `tool_function_query` (
  `query_id` varchar(32) COLLATE utf8_bin NOT NULL COMMENT 'query_id',
  `fun_id` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT 'fun_id',
  `query_name` varchar(60) COLLATE utf8_bin DEFAULT NULL COMMENT '查询方案名称',
  `is_show` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '是否显示',
  `is_default` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '是否为默认查询',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `where_sql` varchar(800) COLLATE utf8_bin DEFAULT NULL COMMENT '查询where语句',
  `memo` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT 'add_userid',
  `add_date` datetime DEFAULT NULL COMMENT 'add_date',
  `modify_userid` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT 'modify_userid',
  `modify_date` datetime DEFAULT NULL COMMENT 'modify_date',
  `record_flag` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '记录标识',
  PRIMARY KEY (`query_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

