/*Table structure for table `tool_i18n` */

DROP TABLE IF EXISTS `tool_i18n`;

CREATE TABLE `tool_i18n` (
  `language_id` varchar(32) NOT NULL COMMENT 'language_id',
  `language_type` varchar(10) DEFAULT NULL COMMENT '分类分组',
  `language_code` varchar(200) DEFAULT NULL COMMENT '语言代号',
  `i18n_default` varchar(500) DEFAULT NULL COMMENT '默认描述',
  `i18n_cn` varchar(500) DEFAULT NULL COMMENT '中文描述',
  `i18n_en` varchar(500) DEFAULT NULL COMMENT '英文描述',
  `i18n_tw` varchar(500) DEFAULT NULL COMMENT '繁体描述',
  `i18n_jp` varchar(500) DEFAULT NULL COMMENT '日文描述',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `module_id` varchar(32) DEFAULT NULL COMMENT 'module_id',
  `fun_id` varchar(32) DEFAULT NULL COMMENT 'fun_id',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  PRIMARY KEY (`language_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gb2312;

/*Data for the table `tool_i18n` */

/*Table structure for table `tool_module` */

DROP TABLE IF EXISTS `tool_module`;

CREATE TABLE `tool_module` (
  `module_id` varchar(32) NOT NULL COMMENT 'module_id',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `module_name` varchar(60) DEFAULT NULL COMMENT '模块名称',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `module_level` int(11) DEFAULT NULL COMMENT '层级',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  `is_show` varchar(10) DEFAULT NULL COMMENT '是否显示',
  `ico_img` varchar(100) DEFAULT NULL COMMENT '模块图标',
  `module_code` varchar(60) DEFAULT NULL COMMENT '模块代号',
  PRIMARY KEY (`module_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gb2312;

