/*Table structure for table `tool_portal` */

DROP TABLE IF EXISTS `tool_portal`;

CREATE TABLE `tool_portal` (
  `portal_id` varchar(32) NOT NULL COMMENT '主键id',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `auditing` varchar(10) DEFAULT NULL COMMENT '发布状态',
