/*Table structure for table `tool_system_module` */

DROP TABLE IF EXISTS `tool_system_module`;

CREATE TABLE `tool_system_module` (
  `system_id` varchar(32) NOT NULL COMMENT 'system_id',
  `system_name` varchar(60) DEFAULT NULL COMMENT '系统名称',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `system_level` int(11) DEFAULT NULL COMMENT '层级',
  `is_show` varchar(10) DEFAULT NULL COMMENT '是否显示',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) DEFAULT NULL COMMENT 'add_userid',
  `add_date` datetime DEFAULT NULL COMMENT 'add_date',
  `modify_userid` varchar(32) DEFAULT NULL COMMENT 'modify_userid',
  `modify_date` datetime DEFAULT NULL COMMENT 'modify_date',
  `record_flag` varchar(10) DEFAULT NULL COMMENT '数据标识',
  `ico_img` varchar(200) DEFAULT NULL COMMENT '图标',
  PRIMARY KEY (`system_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统项目模块表';

