/*Table structure for table `tool_table` */

DROP TABLE IF EXISTS `tool_table`;

CREATE TABLE `tool_table` (
  `table_id` varchar(32) CHARACTER SET gb2312 NOT NULL COMMENT '主键id',
  `project_id` varchar(32) CHARACTER SET gb2312 DEFAULT NULL COMMENT '项目id',
  `order_index` int(11) DEFAULT NULL COMMENT '排序',
  `table_name` varchar(40) CHARACTER SET gb2312 DEFAULT NULL COMMENT '表名',
  `table_comment` varchar(60) CHARACTER SET gb2312 DEFAULT NULL COMMENT '表描述',
  `table_type` varchar(10) CHARACTER SET gb2312 DEFAULT NULL COMMENT '表类型',
  `table_level` int(11) DEFAULT NULL COMMENT '层级',
  `memo` varchar(200) CHARACTER SET gb2312 DEFAULT NULL COMMENT '备注',
  `add_userid` varchar(32) CHARACTER SET gb2312 DEFAULT NULL COMMENT '创建人id',
  `add_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_userid` varchar(32) CHARACTER SET gb2312 DEFAULT NULL COMMENT '修改人id',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `record_flag` varchar(10) CHARACTER SET gb2312 DEFAULT NULL COMMENT '记录标识',
  `is_tree` varchar(10) CHARACTER SET gb2312 DEFAULT NULL COMMENT '是否树型',
  PRIMARY KEY (`table_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

